import { Component } from "react";
import Contacts from "../Contacts/Contacts";


export default class Home extends Component{

    state = {
        products: [
            {id:1 , name:"iphone" , code:123 , price:20000},
            {id:2 , name:"iphone" , code:123 , price:20000},
            {id:3 , name:"iphone" , code:123 , price:20000},
            {id:4 , name:"iphone" , code:123 , price:20000},
            {id:5 , name:"iphone" , code:123 , price:20000},
            {id:6 , name:"iphone" , code:123 , price:20000},
            {id:7 , name:"iphone" , code:123 , price:20000},
            {id:8 , name:"iphone" , code:123 , price:20000},
            {id:9 , name:"iphone" , code:123 , price:20000},
            {id:10 , name:"iphone" , code:123 , price:20000},
            {id:11 , name:"iphone" , code:123 , price:20000}
        ]
    }
    render(){
        return (
            <div className="container">
                <div className="bg-dark px"></div>
                <div className="row gy-4 ">
                {this.state.products.map((x) => <Contacts productDetails= {x} />)}
                </div>
        </div> 
        ) 
        
    }
}
